// InicioComponent.js
import React from 'react';
import { View, Text } from 'react-native';

const HomeComp = () => {
  return (
    <View style={{ flex: 1, justifyContent: 'center', alignItems: 'center' }}>
      <Text>Opción 1</Text>
      <Text>Opción 2</Text>
    </View>
  );
}

export default HomeComp;
